import React from 'react';


const TabSelector = (props) => {

    const { tab, setTab } = props

    return (
        <div>
            {
                tab
                .map((tab, index)=>(
                    <div style={{display: "inline-block"}}>{tab.name}</div>
                ))
            }
        </div>
    )
}


export default TabSelector;
